import Many from "../../../../many";
import './animalBody.css'

function AnimalBody(){

    return(
        <div className='animalBody'>
            <div className='route'>
        <BrowserRouter>
            <p>По меню с лева вы можете выбирать разделы</p>
                <Route path='/animal/dog' component={HomeAnimal} />
                <Route path='/animal/exzotic' component={ExzoticAanimal} />
                <Route/>
                <Route/>
            </BrowserRouter>
            </div>
            <div className='many'>
            <Many/>

            </div>
            <p>sfsfsdfs</p>
        </div>
    )
}
export default AnimalBody;
